import logo from './logo.svg';
import './App.css';

const OPEN_CURLY = "{";
const CLOSE_CURLY = "}";

function App() {
  return (
    <div className="App">
      <img src="https://cdn-icons-png.flaticon.com/256/25/25231.png" alt="https://github.com/NicholasLe04/portfolio" height="75px" width="75px"/>
      <div className="Landing"> 
        <span className="Keyword">public class</span> <a href="https://google.com" className="Method-Class">NicholasLe()</a> {OPEN_CURLY} <br/>
        &emsp;&emsp;<span className="Comment">// View skills and interests</span><br/>
        &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">String</span>[] <span className="Method-Class">getSkillAndInterests</span>()<br/>
        &emsp;&emsp;<span className="Comment">// View projects</span><br/>
        &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">String</span>[] <span className="Method-Class">getProjects</span>()<br/>
        &emsp;&emsp;<span className="Comment">// View resume</span><br/>
        &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">File</span>     <span className="Method-Class">getResume</span>()<br/>
        &emsp;&emsp;<span className="Comment">// View links</span><br/>
        &emsp;&emsp;<span className="Keyword">public</span> <span className="Keyword-2">String</span>[] <span className="Method-Class">getLinks</span>()<br/>
        {CLOSE_CURLY}
      </div>
    </div>
  );
}

export default App;
